import dreaming from '../../Assets/dreaming.png'
import logo from '../../Assets/vividspace2.png'

const signup = () =>  {
  return (
    <div>
      <img src={logo} alt="logoimg" className="w-[180px] h-[65px] mt-2"></img>
    <div>
      <img src={dreaming} alt="dreaming" className='w-[800px] h-[780px]' />
    </div>
    </div>
  )
}

export default signup
